import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <div className="navbar">
      <nav>
        <Link to="/navbar">Home</Link>
        <Link to="/adopt">Adopt</Link>
        <Link to="/shop">Shop</Link>
      </nav>
    </div>
  );
}
